script: |
  super -f text -I q3084.spq | sort > q3084.out

inputs:
  - name: q3084.spq
    data: |
      SELECT DISTINCT + 31 + ( - cor0.col0 ) * - ( 35 ) AS col0 FROM tab0 (FORMAT parquet), tab1 (FORMAT parquet) AS cor0;
  - name: tab0
  - name: tab1

outputs:
  - name: q3084.out
    data: |
      136
      2271
      2831
